import React from 'react'
import um from "./Users.module.css";
import UserPhoto from "../assetss/images/userPhoto.jpg";
import {NavLink} from "react-router-dom";
import Paginator from "../assetss/common/Paginator/Paginator";



let PurifyUsers = (props) => {

    return <div>
        {
            props.Users.map(us => <div key={us.id} className={um.Main}>
                <div>
                    <NavLink to={'/Profile/' + us.id}>
                        <img className={um.img} src={us.photos.small != null ? us.photos.small : UserPhoto}/>
                    </NavLink>
                    <div>
                        {us.followed
                            ? <button disabled={props.InProcess.some(id=> id === us.id)} onClick={() => {
                                props.OnUnFollow(us.id)
                            }} className={um.button}>
                                unfollow
                            </button>

                            : <button disabled={props.InProcess.some(id => id === us.id)} onClick={() => {
                                props.OnFollow(us.id)
                            }} className={um.button}>
                                follow
                            </button>}
                    </div>
                </div>
                <div className={um.Names}>
                    {us.name}
                    <div className={um.Posts}>
                        {us.status}
                    </div>
                </div>
                <div className={um.Country}>
                    {'country'}
                    {','}
                    <div className={um.City}>
                        {'city'}
                    </div>
                </div>
            </div>)
        }
       <Paginator OnChangedPage={props.OnChangedPage}
                  currentPage={props.currentPage}
                  totalUsersCount={props.totalUsersCount}
                      pageSize={props.pageSize}
       />
    </div>
}
export default PurifyUsers
